import { createIcon } from "../icon/createIcon";

export const ChatSolidIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="ChatSolidIcon">
    <path d="M5.75 0a5.75 5.75 0 0 1 4.739 9.008L12 12l-3.005-1.502A5.75 5.75 0 1 1 5.75 0z" />
  </svg>,
  "ChatSolid",
  "chat solid"
);
